import React from 'react';
import './App.css';
import Home from './Components/Home/Home';

function App() {
    let elem = null;
    fetch("/generateOne")
      .then((res) => res.json())
      .then((data) => elem = data);
  return (
  	<div className="App">
    <h1>{elem}</h1>
  		<Home />
    }
  	</div>
  );
}
export default App;
